create table full_social_objects
(
    id                   integer generated by default as identity
            primary key,
    sbid                 varchar(100),
    snid2                text,
    o_name               text,
    o_year_start         text,
    o_year_end           text,
    o_latitude           text,
    o_longitude          text,
    o_rural_district     text,
    category_type        integer,
    source_type          integer,
    region_type          integer,
    o_gategory           text,
    o_rural_settlement   text,
    o_total_project_cost double precision,
    o_unit               text

);

